df = pd.read_csv(csv_file, sep=',')

    for c in df.columns:
        if c == "email":
            continue
        df[c] = df[c].apply(lambda x: ast.literal_eval(x))

    df["sum"] = df["list"].apply(sum)
    df["mean"] = df["sum"] / len(df["list"])
    df["std"] = df["sum"].apply(lambda x: np.sqrt(x / len(df["list"])))

    plot = sns.histplot(data=df, x="mean")

    return (df, plot)
